        html.push('<li', (i % 2 ? ' class="even"' : ''), '><a href="#" onclick="set_of(\'' + of_index.substring(0, 2).toLowerCase() + '\', \'' + element_id + '\')">', of_list[of_index]['name_title'], '</a></li>');
